\");\n\t\t\t\tcdr.ConnectTimestamp = Utils.GetReaderValue<long>(reader, \"connect_timestamp\");\n\t\t\t\tcdr.DisconnectTimestamp = Utils.GetReaderValue<long>(reader, \"disconnect_timestamp\");\n\t\t\t\tcdr.UniqueIdentifier = reader[\"unique_identifier\"] as string;\n\t\t\t\tcdr.FileName = reader[\"file_name\"] as string;\n\t\t\t\tcdr.Calling_First_CI = reader[\"calling_first_ci\"] as string;\n\t\t\t\tcdr.Calling_Last_CI = reader[\"calling_last_ci\"] as string;\n\t\t\t\tcdr.Called_First_CI = reader[\"called_first_ci\"] as string;\n\t\t\t\tcdr.Called_Last_CI = reader[\"called_last_ci\"] as string;\n\t\t\t\tcdr.IntermediateChargingIndicator = Utils.GetReaderValue<int?>(reader, \"intermediate_charging_indicator\");\n\t\t\t\tcdr.IntermediateRecordNumber = Utils.GetReaderValue<int?>(reader, \"intermediate_record_number\");\n\t\t\t\tcdr.GlobalCallReference = reader[\"global_call_reference\"] as string;\n               \n                cdrs.Add(cdr);\n                importedData.LastImportedId = reader[\"Id\"];\n\n                currentCDRId++;\n                rowCount++;\n                if (rowCount ==  batchSize )\n                    break;\n\n            }\n            if (cdrs.Count > 0)\n            {\n                var batch = Vanrise.GenericData.QueueActivators.DataRecordBatch.CreateBatchFromRecords(cdrs, \"#RECORDSCOUNT# of Raw CDRs\", \"MobileAnalysis_CDR\");\n                mappedBatches.Add(\"Store File Mobile Analysis CDRs\", batch);\n            }\n            else\n                importedData.IsEmpty = true;\n\n            Vanrise.Integration.Entities.MappingOutput result = new Vanrise.Integration.Entities.MappingOutput();\n            result.Result = Vanrise.Integration.Entities.MappingResult.Valid;\n            LogVerbose(\"Finished\");\n            return result;","ExecutionFlowId":"53312296-82dc-4844-aa72-3255ef577698"}')
